import{_ as a,o as e,c as r,d as t}from"./app.3398e39f.js";var d="/assets/blogImg/diary-29.jpg";const h={},p=t('<h2 id="date-2017-06-05-03-55" tabindex="-1"><a class="header-anchor" href="#date-2017-06-05-03-55" aria-hidden="true">#</a> date: 2017-06-05 03:55</h2><p><img src="'+d+'" alt="Picture by Matt Carlson"></p><h3 id="\u4E00\u3001" tabindex="-1"><a class="header-anchor" href="#\u4E00\u3001" aria-hidden="true">#</a> \u4E00\u3001</h3><p>\u6BCF\u4E2A\u6625\u5929\uFF0C\u5019\u9E1F\u90FD\u4F1A\u6765\u5230\u8FD9\u7247\u82B1\u7530\u3002 \u6BCF\u4E2A\u4E0D\u662F\u6625\u5929\u7684\u5B63\u8282\uFF0C\u82B1\u5320\u603B\u5728\u8BA4\u771F\u5730\u6253\u7406\u82B1\u7530\u3002\u82B1\u5320\u60F3\u8BA9\u4E00\u5207\u770B\u8D77\u6765\u672A\u6765\u53EF\u671F\uFF0C\u56E0\u4E3A\u4ED6\u559C\u6B22\u8FD9\u53EA\u5019\u9E1F\u3002\u559C\u6B22\uFF0C\u662F\u56E0\u4E3A\u4ED6\u4EEC\u90FD\u7231\u82B1\u3002\u90A3\u4E9B\u5173\u4E8E\u82B1\u7684\u8BDD\u9898\uFF0C\u4ED6\u4EEC\u6C38\u8FDC\u804A\u4E0D\u5B8C\u3002</p><p>\u6709\u4E00\u4E2A\u6625\u5929\uFF0C\u5019\u9E1F\u8DDF\u82B1\u5320\u8BF4\u8D77\u4E86\u5979\u5BB6\u4E61\u7684\u96EA\u83B2\u3002 \u8FD9\u79CD\u82B1\uFF0C\u82B1\u5320\u4ECE\u6765\u6CA1\u542C\u8BF4\u8FC7\u3002\u4F46\u6BCF\u6B21\u8BF4\u8D77\u96EA\u83B2\uFF0C\u82B1\u5320\u90FD\u80FD\u6CE8\u610F\u5230\u5979\u773C\u4E2D\u98DE\u626C\u7684\u5149\u4EAE\u3002\u662F\u7684\uFF0C\u90A3\u662F\u5019\u9E1F\u6700\u5FC3\u7231\u7684\u82B1\u513F\u3002</p><h3 id="\u4E8C\u3001" tabindex="-1"><a class="header-anchor" href="#\u4E8C\u3001" aria-hidden="true">#</a> \u4E8C\u3001</h3><p>\u82B1\u5320\u51B3\u5B9A\u8981\u53BB\u6458\u4E00\u6735\u96EA\u83B2\u3002 \u4ED6\u6CA1\u6709\u7FC5\u8180\uFF0C\u9700\u8981\u8DE8\u8FC7\u65E0\u6570\u9AD8\u5C71\u4E0E\u5927\u6D77\u3002\u4ED6\u4E5F\u6CA1\u6709\u51FA\u884C\u7684\u7ECF\u9A8C\uFF0C\u6536\u62FE\u7B80\u5355\u7684\u884C\u674E\u90FD\u4F1A\u4E22\u4E09\u843D\u56DB\u3002\u800C\u4E14\u4ED6\u8FD8\u5F88\u64C5\u957F\u5E7B\u60F3\uFF0C\u8FD9\u662F\u4E00\u4E2A\u81F4\u547D\u7684\u5F31\u70B9\u3002\u6E56\u6CCA\u7684\u6C34\u602A\uFF0C\u96EA\u5C71\u7684\u5DE8\u4EBA\uFF0C\u65F6\u957F\u51FA\u73B0\u5728\u68A6\u4E2D\u3002 \u4E0D\u8FC7\uFF0C\u4ED6\u8FD8\u662F\u51FA\u53D1\u4E86\u3002\u82B1\u5320\u771F\u60F3\u770B\u770B\u96EA\u83B2\u7684\u59FF\u6001\u3002 \u4ED6\u89C9\u5F97\u81EA\u5DF1\u4F1A\u559C\u6B22\u96EA\u83B2\u7684\uFF0C\u56E0\u4E3A\u5019\u9E1F\u7684\u559C\u6B22\u3002</p><p>\u4ECE\u6765\u6CA1\u6709\u5982\u6B64\u6F2B\u957F\u7684\u65C5\u7A0B\u3002\u82B1\u5320\u53D7\u4E86\u4F24\uFF0C\u7559\u4E86\u8840\uFF0C\u9760\u7740\u82B1\u8336\u6CBB\u6108\uFF0C\u53C8\u7EE7\u7EED\u524D\u884C\u3002\u540E\u6765\uFF0C\u5728\u4E0E\u5DE8\u718A\u640F\u6597\u65F6\uFF0C\u4ED6\u6EDA\u843D\u4E86\u5C71\u5D16\u3002\u773C\u4E2D\u900F\u7740\u4E00\u5C42\u8840\u96FE\uFF0C\u4ED6\u770B\u5230\u4E86\u4E00\u6735\u96EA\u83B2\u3002</p><p>\u4ED6\u89C9\u5F97\u9700\u8981\u772F\u8D77\u773C\u775B\uFF0C\u624D\u6562\u6B23\u8D4F\u96EA\u83B2\u7684\u7F8E\u4E3D\u3002\u4EFF\u4F5B\u5468\u906D\u90FD\u662F\u9ED1\u6697\u7684\uFF0C\u53EA\u6709\u8FD9\u6735\u82B1\uFF0C\u6563\u53D1\u51FA\u86DB\u4E1D\u4E00\u6837\u7EC6\u7684\u5149\u7EBF\uFF0C\u7136\u540E\u8D8A\u6765\u8D8A\u6D53\u539A\uFF0C\u53D8\u6210\u4E86\u7EAF\u6D01\u7684\u7FBD\u7ED2\uFF0C\u6E29\u6696\u5730\u62E8\u5F00\u4ED6\u7684\u773C\u5E18\u3002\u7136\u540E\u4ED6\u79F0\u8D5E\u9053\uFF0C\u597D\u7F8E\u554A\u3002</p><h3 id="\u4E09\u3001" tabindex="-1"><a class="header-anchor" href="#\u4E09\u3001" aria-hidden="true">#</a> \u4E09\u3001</h3><p>\u5C31\u8FD9\u6837\uFF0C\u5728\u4E0B\u4E00\u4E2A\u6625\u5929\uFF0C\u82B1\u5320\u628A\u96EA\u83B2\u9001\u7ED9\u4E86\u5019\u9E1F\u3002\u4ED6\u5FAE\u7B11\u7740\uFF0C\u5728\u7B49\u5F85\u5979\u7684\u53CD\u5E94\u3002 \u5019\u9E1F\u8BF4\uFF1A\u201C\u8C22\u8C22\u4F60\u3002\u4F46\u6211\u53EA\u80FD\u8BF4\u8C22\u8C22\uFF0C\u8BF4\u4E0D\u51FA\u5176\u4ED6\u7684\u8BDD\u6765\u4E86\u3002\u56E0\u4E3A\u8FD9\u6735\u82B1\u5F88\u666E\u901A\uFF0C\u6211\u77E5\u9053\u5B83\u4EEC\u76DB\u5F00\u5728\u54EA\u4E2A\u5C71\u8C37\uFF0C\u6211\u6325\u4E00\u6325\u7FC5\u8180\u5C31\u80FD\u53D6\u5230\u3002\u867D\u7136\u4F60\u5F88\u8F9B\u82E6\uFF0C\u4F46\u6211\u7406\u89E3\u4E0D\u4E86\u4F60\uFF0C\u8BF7\u4F60\u539F\u8C05\u3002\u201D</p><p>\u82B1\u5320\u6709\u4E00\u70B9\u70B9\u5931\u843D\u3002\u4ED6\u4E0D\u5B89\u5730\u6478\u6478\u81EA\u5DF1\u5934\uFF0C\u8FD8\u6709\u4E9B\u8BB8\u5C34\u5C2C\u3002\u4F46\u4ED6\u4E5F\u5F00\u59CB\u660E\u767D\u4E00\u4E9B\u9053\u7406\u3002\u4ED6\u60F3\u8D77\u300A\u5C0F\u738B\u5B50\u300B\u91CC\u7684\u90A3\u6735\u72EC\u4E00\u65E0\u4E8C\u7684\u73AB\u7470\u3002</p><p>\u5019\u9E1F\u5B89\u6170\u82B1\u5320\u8BF4\uFF1A\u201C\u6765\u5E74\u6625\u5929\uFF0C\u6211\u634E\u6765\u4E00\u679D\u6700\u597D\u7684\u96EA\u83B2\u9001\u4F60\uFF0C\u597D\u5417\uFF1F\u201D \u82B1\u5320\u91CD\u65B0\u9732\u51FA\u4E86\u7B11\u5BB9\uFF0C\u56E0\u4E3A\u6CA1\u6709\u4EC0\u4E48\uFF0C\u6BD4\u7231\u4EBA\u7684\u793C\u7269\u66F4\u503C\u5F97\u671F\u5F85\u4E86\u3002</p><h3 id="\u56DB\u3001" tabindex="-1"><a class="header-anchor" href="#\u56DB\u3001" aria-hidden="true">#</a> \u56DB\u3001</h3><p>\u5019\u9E1F\u79BB\u53BB\u4E0D\u4E45\uFF0C\u82B1\u5320\u5C31\u5F00\u59CB\u62C5\u5FC3\u8D77\u6765\u3002\u56E0\u4E3A\u4ED6\u786E\u5B9E\u64C5\u957F\u5E7B\u60F3\u3002 \u4ED6\u62C5\u5FC3\u8FD9\u6735\u96EA\u83B2\uFF0C\u4F1A\u6210\u4E3A\u5019\u9E1F\u8FC1\u5F99\u7684\u7D2F\u8D58\u3002\u591C\u6765\u65E0\u7720\uFF0C\u4ED6\u8111\u4E2D\u5C3D\u662F\u60F3\u8C61\u5019\u9E1F\u7167\u770B\u96EA\u83B2\u7684\u60C5\u666F\u3002</p><p>\u96EA\u83B2\u9700\u8981\u6C34\u5206\uFF0C\u5979\u4F1A\u4E0D\u4F1A\u5728\u6CB3\u8FB9\u6D47\u704C\uFF1F\u90A3\u91CC\u4F1A\u4E0D\u4F1A\u6709\u9CC4\u9C7C\uFF1F \u96EA\u83B2\u9700\u8981\u9633\u5149\uFF0C\u5979\u4F1A\u4E0D\u4F1A\u767B\u4E0A\u6700\u9AD8\u7684\u5C71\u5934\uFF1F\u90A3\u91CC\u4F1A\u4E0D\u4F1A\u6709\u731B\u79BD\uFF1F \u96EA\u83B2\u7684\u82B1\u74E3\u90A3\u4E48\u5A07\u5AE9\uFF0C\u5979\u662F\u4E0D\u662F\u4E0D\u80FD\u81EA\u7531\u98DE\u884C\uFF1F</p><p>\u6B63\u5F53\u82B1\u5320\u4EE5\u4E3A\u5019\u9E1F\u4F1A\u56E0\u4E3A\u4E0D\u987A\u7545\u7684\u65C5\u9014\uFF0C\u800C\u59D7\u59D7\u6765\u8FDF\u65F6\uFF0C\u5019\u9E1F\u7ED9\u4E86\u4ED6\u4E00\u4E2A\u610F\u5916\u3002\u8FD9\u4E00\u4E2A\u6625\u5929\uFF0C\u5979\u751A\u81F3\u6BD4\u4EE5\u5F80\u66F4\u65E9\u51FA\u73B0\u5728\u4ED6\u9762\u524D\u3002 \u5979\u5634\u91CC\u53FC\u7740\u4E00\u6735\u96EA\u83B2\uFF0C\u4E00\u6735\u6700\u7F8E\u7684\u96EA\u83B2\u3002</p><p>\u201C\u8C22\u8C22\u4F60\uFF0C\u6CA1\u6709\u4EC0\u4E48\u6BD4\u8FD9\u66F4\u7F8E\u7684\u4E86\uFF01\u201D\u82B1\u5320\u8BF4\u3002 \u5019\u9E1F\u56DE\u7B54\u8BF4\uFF1A\u201C\u53EF\u4E0D\u662F\u5417\uFF1F\u6211\u542C\u5148\u884C\u7684\u670B\u53CB\u8BF4\uFF0C\u4F60\u5BB6\u9644\u8FD1\u7684\u5C71\u8C37\u91CC\uFF0C\u4E5F\u5F00\u4E86\u8FD9\u79CD\u82B1\uFF0C\u6240\u4EE5\u6211\u6CA1\u6709\u4ECE\u5BB6\u4E61\u5E26\uFF0C\u6211\u521A\u521A\u5230\u90A3\u513F\u91C7\u7684\uFF01\u5C31\u5728\u4E0D\u8FDC\u7684\u5730\u65B9\u3002\u201D</p><h3 id="\u4E94\u3001" tabindex="-1"><a class="header-anchor" href="#\u4E94\u3001" aria-hidden="true">#</a> \u4E94\u3001</h3><p>\u4E00\u79CD\u83AB\u540D\u7684\u5931\u843D\u611F\u7B3C\u7F69\u4E86\u82B1\u5320\u3002\u4ED6\u89C9\u5F97\u8FD9\u6735\u96EA\u83B2\u4E00\u70B9\u90FD\u4E0D\u7F8E\u4E86\u3002 \u81F3\u5C11\uFF0C\u8981\u6BD4\u81EA\u5DF1\u91C7\u7684\u90A3\u6735\u201C\u666E\u901A\u7684\u201D\u96EA\u83B2\u5DEE\u5F97\u591A\u3002\u4ED6\u751A\u81F3\u6709\u70B9\u538C\u6076\u96EA\u83B2\u6563\u53D1\u51FA\u7684\uFF0C\u86DB\u4E1D\u822C\u7684\u5149\u8292\uFF0C\u90A3\u4E9B\u53EF\u6076\u7684\u5149\u8292\uFF0C\u4E0B\u4E00\u523B\u597D\u50CF\u5C31\u8981\u53D8\u6210\u5DE8\u7F51\uFF0C\u5411\u4ED6\u6251\u6765\uFF0C\u4EE4\u4EBA\u7A92\u606F\u3002</p><p>\u5019\u9E1F\u5F88\u4F24\u5FC3\uFF0C\u5979\u53F9\u6C14\u8BF4\uFF1A\u201C\u6211\u4E0D\u61C2\u3002\u201D \u82B1\u5320\u4E5F\u6447\u6447\u5934\uFF0C\u4ED6\u4E5F\u4E0D\u61C2\u81EA\u5DF1\u4E3A\u4F55\u60B2\u4F24\u3002 \u5019\u9E1F\u7EE7\u7EED\u8BF4\uFF1A\u201C\u90A3\u662F\u4E00\u4E2A\u627F\u8BFA\uFF0C\u6211\u6CA1\u6709\u5FD8\u8BB0\uFF0C\u867D\u7136\u9E1F\u513F\u8BB0\u6027\u90FD\u4E0D\u597D\uFF0C\u5BF9\u5417\uFF1F\u201D \u82B1\u5320\u8BF4\uFF1A\u201C\u662F\u7684\u3002\u201D \u5019\u9E1F\u8BF4\uFF1A\u201C\u96EA\u83B2\u5F00\u653E\u5728\u4F60\u7684\u82B1\u7530\u4E0D\u8FDC\u7684\u5C71\u8C37\uFF0C\u662F\u597D\u4E8B\u5417\uFF1F\u201D \u82B1\u5320\u8BF4\uFF1A\u201C\u592A\u597D\u4E86\u3002\u201D \u5019\u9E1F\u8BF4\uFF1A\u201C\u521A\u91C7\u7684\u96EA\u83B2\u662F\u6700\u9C9C\u8273\u7684\uFF0C\u6211\u60F3\u4F60\u80FD\u770B\u5230\u5B83\u6700\u7F8E\u7684\u6837\u5B50\u3002\u201D \u82B1\u5320\u8BF4\uFF1A\u201C\u8C22\u8C22\u4F60\u3002\u201D</p><p>\u4F46\u82B1\u5320\u4E5F\u53EA\u80FD\u8BF4\u8C22\u8C22\uFF0C\u8BF4\u4E0D\u51FA\u5176\u4ED6\u7684\u8BDD\u6765\u4E86\u3002</p><p>\u2014\u2014Litten 2017.6.5 \u56DB\u70B9\u534A</p>',23),i=[p];function n(s,c){return e(),r("div",null,i)}var l=a(h,[["render",n],["__file","my-fairy-tale4.html.vue"]]);export{l as default};
